import { useNavigate } from "react-router-dom";
import './Cabecalho.css'

function Cabecalho() {
    const navigate = useNavigate();
    return( 
        <header  className="Cabecalho"> 
            <img src=".\logo-libmap.svg" alt=''  onClick={() => {
        navigate("/",);
      }}/>
        </header>
    );
}
export default Cabecalho;
